import { useState } from 'react';
import { Button, TextField, Typography, Box, Paper } from '@mui/material';
import axios from 'axios';

const Withdraw = ({ userId }) => {
  const [amount, setAmount] = useState('');

  const handleWithdraw = async () => {
    try {
      const response = await axios.post('/api/withdraw', { userId, amount });
      alert('Withdraw request created successfully!');
    } catch (error) {
      alert('Failed to create withdraw request');
    }
  };

  return (
    <Box 
      sx={{
        display: 'flex', 
        justifyContent: 'center', 
        alignItems: 'center', 
        height: '100vh', 
        padding: 2
      }}
    >
      <Paper 
        elevation={3} 
        sx={{
          width: '100%', 
          maxWidth: 400, 
          padding: 3, 
          textAlign: 'center'
        }}
      >
        <Typography variant="h5" gutterBottom>
          Withdraw Funds
        </Typography>
        <TextField
          label="Enter withdraw amount"
          type="number"
          fullWidth
          value={amount}
          onChange={(e) => setAmount(e.target.value)}
          sx={{ marginBottom: 2 }}
        />
        <Button 
          variant="contained" 
          color="primary" 
          onClick={handleWithdraw}
          fullWidth
        >
          Request Withdrawal
        </Button>
      </Paper>
    </Box>

  );
};

export default Withdraw;
